import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

export default class extends React.Component {
    render() {
        return (
            <div className='contenedor'>
                Hola
                <style jsx>{`
                    .contenedor{
                        color: blue;
                    }
                `}</style>
            </div>
        );
    }
}
